public void init()
{
    boolean inTransitPlanning;

    whsLoadTableFormArgs = WHSLoadTableFormArgs::newFromArgs(element.args());
    whsLoadTableForm = whsLoadTableFormArgs.whsLoadTableForm;
    loadIdList = whsLoadTableFormArgs.loadIdList;

    whsLoadPlanningListPageForm = new WHSLoadPlanningListPageForm();

    super();

    inTransitPlanning = TMSParameters::find().InTransitPlanning;
    ButtonGroupHubConsolidation.visible(inTransitPlanning);
    OverrideLocation.visible(inTransitPlanning);
    btnPostShipTransfer.visible(whsLoadPlanningListPageForm.shouldBtnPostShipTransferBeVisible());

    PackingSlipParameters.visible(populatePackingSlipIdFromShipmentFlightEnabled);

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public void run()
{
    WHSLoadId   loadId;

    super();

    if (whsLoadTableFormArgs.forceSingleLoadId)
    {
        loadId = whsLoadTableFormArgs.forceSingleLoadId;
        element.args().lookupRecord(WHSLoadTable::find(loadId));
        WHSLoadTable_ds.research(false);
    }

}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm inventDimParmLocal;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_WHS::newFromForm(element);
                inventDimParmLocal.setAllProductDimensions();
                inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmLocal);
            }

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

