public void init()
{
    QueryBuildDataSource qbds;

    super();

    qbds = whsLoadTable_q.dataSourceTable(tableNum(WHSLoadTable));

    boolean mustFilterByLoadId = whsLoadTableFormArgs.canApplyLoadFilter();

    if (mustFilterByLoadId)
    {
        if (!loadIdList)
        {
            qbds.clearDynalinks();
            element.createLoadIdList();
        }
        qbds.addRange(fieldNum(WHSLoadTable, LoadId)).value(!loadIdList ? SysQuery::valueEmptyString() : loadIdList);
    }
}

public void enableTMSActions(boolean _enable)
{
    TabTransportation.enabled(_enable);
    ActionPaneTabTMS.enabled(_enable);

    TransportationTender.enabled(_enable && whsLoadTable.isAssociableToTender());
    tmsInvoiceJournal.enabled(_enable && TMSFreightBillDetail::existsInvoiceJournal(whsLoadTable.RouteCode, whsLoadTable.LoadId));
    manualRoute.enabled(_enable && whsLoadTable.RouteCode == '');
    addRoute.enabled(_enable 
                     && !whsLoadTable.RouteCode 
                     && whsLoadTable.LoadDirection == WHSLoadDirection::Inbound);
}

public int active()
{
    int ret;
    WHSWorkLine whsWorkLine;

    ret = super();

    this.enableTMSFields(whsLoadTable.LoadStatus != WHSLoadStatus::Shipped);
    this.enableTMSActions(whsLoadTable.canUseTMSActions());

    if (WHSLoadTable.LoadDirection == WHSLoadDirection::Inbound)
    {
        element.enableOverUnderDeliveryFields(false);
        element.toggleOverDeliveryField(true);
        element.enableUnShipQtyButton(false);
        element.toggleDeliveryPolicyControl(true);
        element.toggleProductReceiptProcessingStatusControl(true);
    }
    else
    {
        element.enableOverUnderDeliveryFields(true);
        element.enableUnShipQtyButton(true);
        element.toggleDeliveryPolicyControl(false);
        element.toggleProductReceiptProcessingStatusControl(false);
    }

    btnInboundShipConfirm.enabled(WHSPostPackingSlip::isShipConfirmEnabled(whsLoadTable));
    btnProductReceipt.enabled(WHSPostPackingSlip::isPackingSlipEnabled(whsLoadTable));
    btnOutboundShipConfirm.enabled(WHSShipConfirmationAction::newFromBuffer(whsLoadTable).canEnableShipConfirm());
    WHSSalesPackingSlipPost.enabled(WHSShipConfirm::isPackingSlipEnabledForBuffer(whsLoadTable));
    PackingSlipParameters.allowEdit(populatePackingSlipIdFromShipmentFlightEnabled
        && whsLoadTable.canUsePackingSlipCreationPolicy());
    PackingSlipBackgroundPosting.visible(whsLoadTable.LoadDirection == WHSLoadDirection::Outbound);

    btnSendASN.enabled(WHSShipConfirm::isSendASNEnabledForLoad(whsLoadTable));
    btnBillOfLading.enabled(WHSShipConfirm::isBOLEnabledForLoad(whsLoadTable));
    btnReverseShipConfirm.enabled(WHSReverseShipConfirm::canShipConfirmationBeReversed(whsLoadTable));
    btnCancelPackingSlips.enabled(WHSReverseShipConfirm::canCancelSalesPackingSlip(whsLoadTable));
    btnPostShipTransfer.enabled(WHSShipConfirm::canShipTransferOrder(whsLoadTable));
    btnCancelProductReceipt.enabled(WHSReverseShipConfirm::canCancelProductReceipt(whsLoadTable));
    WHSWaveLabel.enabled(WHSWaveLabel::existLoadId(WHSLoadTable.LoadId));

    WHSLoadTable_ds.object(fieldNum(WHSLoadTable, LoadReceivingCompletedUTCDateTime)).visible(WHSLoadTable.receivingCompletedProcessEnabledForLoad());
    if (WHSShipConfirmServiceImplementsSplitShipmentInBatchFlight::instance().isEnabled())
    {
        WHSLoadTable_ds.object(fieldNum(WHSLoadTable, LoadSplitShipConfirmPolicy)).enabled(WHSLoadTable.AllowLoadSplitShipConfirm);
    }
    btnInboundReceivingCompleted.enabled(WHSLoadTable.canCompleteReceiving());
    btnInboundReverseReceivingCompleted.enabled(WHSLoadTable.canReverseReceivingCompleted());

    boolean transportLoadShipped = whsLoadTable.isAnyRelatedTransportLoadShipped();
    boolean packingSlipUpdated = whsLoadTable.isAnyRelatedPackingSlipUpdated();

    change.enabled(whsLoadTable.LoadStatus != WHSLoadStatus::Shipped && !transportLoadShipped);
    skipWorkLine.enabled(whsLoadTable.LoadStatus < WHSLoadStatus::Loaded && whsLoadTable.LoadStatus >= WHSLoadStatus::Posted);
    whsReverseWork.enabled(whsLoadTable.LoadStatus >= WHSLoadStatus::Posted
                        && whsLoadTable.LoadStatus != WHSLoadStatus::Shipped
                        && whsLoadTable.LoadStatus != WHSLoadStatus::Received
                        && !transportLoadShipped
                        && !packingSlipUpdated);

    select firstonly RecId from whsWorkLine
        where whsWorkLine.LoadId == whsLoadTable.LoadId;

    if (whsWorkLine.RecId > 0)
    {
        whsPickListShipping.enabled(true);
    }
    else
    {
        whsPickListShipping.enabled(false);
    }

    boolean transportLoadExists = whsLoadTable.LoadingStrategy == WHSLoadingStrategy::PartialLoadShippingAllowed 
                               && WHSTransportLoad::existsForLoadId(whsLoadTable.LoadId);

    whsLoadTable_ds.allowEdit(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);
    whsLoadTable_ds.allowDelete(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);
    whsShipmentTable_ds.allowEdit(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped && transportLoadExists);
    whsShipmentTable_ds.allowDelete(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped && transportLoadExists);
    whsLoadLine_ds.allowEdit(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);
    whsLoadLine_ds.allowDelete(whsLoadTable.LoadStatus < WHSLoadStatus::Shipped);

    whsLoadTableForm.parmWHSLoadId(whsLoadTable.LoadId);

    return ret;
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    InventTrackingRegisterTrans.enabled(
        WHSLoadLine.InventTransType == InventTransType::Sales
        && InventTable::find(WHSLoadLine.ItemId).isSalesProcessSerialActive());

    element.enablePickedInventoryButton();

    return ret;
}

public void clicked()
{
    if (whsLoadTable.LoadSplitShipConfirmPolicy != WHSLoadSplitShipConfirmPolicy::ManualSelection && WHSOutboundShipConfirmBtnOnLoadTableUsesOutboundShipConfirmControllerFlight::instance().isEnabled())
    {
        Args args = new Args();
        args.caller(element);
        new MenuFunction(menuItemActionStr(WHSOutboundShipConfirm), MenuItemType::Action).run(args);
    }
    else
    {
        super();
    }
}

public void clicked()
{
    if (WHSDisplayConfirmationOnLoadReceivingCompletedConfirmationFlight::instance().isEnabled())
    {
        boolean proceed = whsLoadPlanningListPageForm.hasAcceptedUnderOverDelivery(whsLoadTable);
        if (proceed)
        {
            whsLoadLine_ds.executeQuery();
            super();
        }
    }
    else
    {
        super();
    }
}

public void clicked()
{
    Args args = new Args();
    args.caller(this);
    args.parmObject(WHSLoadTable_DS);

    new MenuFunction(menuItemActionStr(WHSBillOfLadingGenerate), MenuItemType::Action).run(args);

    whsShipmentTable_ds.executeQuery();
}

public boolean modified()
{
    boolean ret = super();

    whsLoadTable_ds.enableTMSActions(whsLoadTable.canUseTMSActions());

    return ret;
}

public boolean modified()
{
    boolean ret;

    ret = super();

    whsLoadTable_ModeCode.allowEdit(whsLoadTable.CarrierCode == '');

    return ret;
}
